import { useEffect, useState } from "react"

export default function AgentOrdreq () {

    const [orderReqDetail, setDetail] = useState();

    useEffect(()=>{
        const userDetail = sessionStorage.getItem("user")
        console.log("details ",userDetail)
        const options = {
            method : 'POST',
            headers : {
                'Content-Type' : 'application/json'
            },
            body : JSON.stringify({userDetail})
        }

        fetch('http://127.0.0.1:5000/api/Agent/Requests',options)  // API endpoint of your Flask server
        .then(response => response.json())
        .then(data => {
        console.log("data ",data)
        setDetail(data)
        })
        .catch(error => {
        console.error('Error:', error);
    });
    },[]);

    return (
        <div>
            <h1> Delivery Requests </h1>
            <div>
                {orderReqDetail.map((item) => (
                    <div>{item}</div>
                ))}
            </div>
        </div>
    )
}
